/*
*  This schema is used to supplement content to a web page.
*  Multiple instances can be created and may be referenced to.
*/
import { FiLayout } from "react-icons/fi"

export default {
    name: 'pageTemplate',
    title: 'Page Template',
    icon: FiLayout,
    type: 'document',
    fields: [
        {
            name: 'templateName',
            title: 'Template Name',
            description: 'Add a name to your template to easily identify what it will be used for. Example: About Us template',
            type: 'string'
        },
        {
            name: 'addContent',
            title: 'Add Content',
            description: 'Select content you want for this template.',
            type: 'array', //this shows a dropdown of contents user can select from 
            of: [
                { 
                    name: 'addMenu',
                    title: 'Add page menu',
                    type: 'reference' ,
                    to: [{ type: 'addNavMenu' }]
                },
                { 
                    name: 'addPageHeader',
                    title: 'Add page header',
                    type: 'reference',
                    to: [{type: 'addHeader'}] 
                },  
                { 
                    name: 'addPageFooter',
                    title: 'Add page footer',
                    type: 'reference',
                    to: [{type: 'addFooter'}] 
                },
                { 
                    name: 'addATable',
                    title: 'Add a table',
                    type: 'reference',
                    to: [{type: 'addTable'}] 
                },
                { 
                    name: 'addText',
                    title: 'Add Text',
                    type: 'reference',
                    to: [{type: 'addTextOnly'}] 
                },
                { 
                    name: 'addImage',
                    title: 'Add image',
                    type: 'reference',
                    to: [{type: 'addImageOnly'}] 
                },
                { 
                    name: 'addImageWithText',
                    title: 'Add image with text',
                    type: 'reference',
                    to: [{type: 'addImageText'}] 
                }
            ]
        }
    ]
}

